import Foundation
import UIKit
import SnapKit

class ChooseCollectionViewCell: UICollectionViewCell {
    static var reuseIdentifier: String {
        get {
            return "ChooseCollectionViewCell"
        }
    }

    var data: Feeling? {
        didSet {
            guard let _data = data else { return }

            imageView.image = _data.image
            feelingLabel.text = _data.visibleFeelName()
            checkImageView.isHidden = !_data.isSelected
        }
    }

    private lazy var imageView: UIImageView = {
        let view = UIImageView()
        view.setRounded()
        return view
    }()

    private lazy var feelingLabel: UILabel = {
        let label = UILabel()
        label.numberOfLines = 0
        label.textColor = .white
        label.font = .boldSystemFont(ofSize: 15)
        label.textAlignment = .center
        return label
    }()

    private lazy var checkImageView: UIImageView = {
        let view = UIImageView()
        view.isHidden = true
        view.image = #imageLiteral(resourceName: "checkmark.circle.fill")
        view.setTint(.green)
        return view
    }()

    required init?(coder: NSCoder) {
        super.init(coder: coder)

        setupViews()
    }

    override init(frame: CGRect) {
        super.init(frame: .zero)

        setupViews()
    }

    private func setupViews() {
        contentView.addSubview(imageView)
        contentView.addSubview(feelingLabel)
        contentView.addSubview(checkImageView)

        imageView.snp.makeConstraints { make in
            make.top.leading.trailing.equalToSuperview()
            make.height.equalTo(contentView.snp.width)
        }

        feelingLabel.snp.makeConstraints { make in
            make.leading.trailing.equalToSuperview()
            make.top.equalTo(imageView.snp.bottom).offset(8)
        }

        checkImageView.snp.makeConstraints { make in
            make.width.equalTo(24)
            make.height.equalTo(24)
            make.top.equalToSuperview().offset(8)
            make.trailing.equalToSuperview().offset(-8)
        }
    }
}
